public static String getFileMethod(BufferedReader reader, String methodName, boolean numbers) {
    int count = 0;
    StringBuffer sb = new StringBuffer();
    boolean echo = false;
    boolean startCount = false;
    int parenCount = 0;
    try {
        String line;
        while ((line = reader.readLine()) != null) {
            if ((line.indexOf(methodName) != -1) && ((line.indexOf("public") != -1) || (line.indexOf("protected") != -1) || (line.indexOf("private") != -1))) {
                echo = true;
                startCount = true;
            }
            if (echo && startCount) {
                if (numbers) {
                    sb.append(pad(++count) + "    ");
                }
                sb.append(line + "\n");
            }
            if (echo && (line.indexOf("{") != -1)) {
                parenCount++;
            }
            if (echo && (line.indexOf("}") != -1)) {
                parenCount--;
                if (parenCount == 0) {
                    startCount = false;
                    echo = false;
                }
            }
        }
        reader.close();
    } catch (Exception e) {
        System.out.println(e);
        e.printStackTrace();
    }
    return (sb.toString());
}

